		<script src="jquery.js"></script>
		<script type="text/javascript" defer>
			// set colors
			(function(){
				var isMouseDown = false;
				document.addEventListener('mousedown', function(e) {
					isMouseDown = true;
				});

				document.addEventListener('mouseup', function(e) {
					isMouseDown = false;
				});

				var colors = document.querySelectorAll('.legend li span');
				var currentColor = null;

				[].forEach.call(colors, function(node){
					node.addEventListener("click", function(e){
						var active = document.querySelector('.legend li.active');

						if( active )
							document.querySelector('.legend li.active').classList.remove('active');

						if( this.dataset.color === currentColor ) {
							currentColor = null;
						}
						else {
							this.parentElement.classList.add('active');
							currentColor = this.dataset.color;
						}
					});
				});

				var polys = document.getElementsByTagName('polygon');

				[].forEach.call(polys, function(node){
					node.addEventListener("mouseover", function(e){
						if( isMouseDown ) {
							this.setAttribute('class', 'grid');

							if( currentColor ) {
								this.classList.add(currentColor);
							}
						}
					});
				}, true);
			})();
			// set relationships
			(function(){
				$('polygon').on('customeventage', function(e){
					var $this = $(this),
						data = $this.data(),
						bBox = e.target.getBoundingClientRect();

					data.n = $this.prev().attr('id');
					data.s = $this.next().attr('id');
					data.nw = $(document.elementFromPoint(bBox.top, bBox.left)).not('svg').attr('id');
					data.sw = $(document.elementFromPoint(bBox.top, bBox.bottom)).not('svg').attr('id');
					data.ne = $(document.elementFromPoint(bBox.right, bBox.top)).not('svg').attr('id');
					data.se = $(document.elementFromPoint(bBox.right, bBox.bottom)).not('svg').attr('id');

					$.each(data, function(k, v){
						if(v)
							$this.attr('data-links-'+k, v);
					});
				}).trigger('customeventage');
			})();
		</script>
